INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (150, "ぺコリーヌ", 1, "今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪", 91002, 8, 1, 37, 0, 107501, 40001);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (150, "コッコロ", 2, "この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪", 91002, 8, 1, 38, 0, 107601, 40001);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (150, "キャル", 3, "あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪", 91002, 8, 1, 39, 0, 107801, 40001);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (150, "スズメ", 4, "あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！", 91002, 8, 1, 40, 0, 107701, 40001);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (150, "タマキ", 5, "今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪", 91002, 8, 1, 41, 0, 107901, 40001);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (150, "ぺコリーヌ", 6, "う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪", 91002, 8, 2, 42, 0, 107501, 40001);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (150, "コッコロ", 7, "夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ", 91002, 8, 2, 43, 0, 107601, 40001);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (150, "キャル", 8, "ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！", 91002, 8, 2, 44, 0, 107801, 40001);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (150, "スズメ", 9, "あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪", 91002, 8, 2, 45, 0, 107701, 40001);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (150, "タマキ", 10, "夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？", 91002, 8, 2, 46, 0, 107901, 40001);
